        "privacyTerms": MessageLookupByLibrary.simpleMessage(
            "Chini ya sheria za Kivietinamu, maelezo ya watumiaji kama vile majina, anwani za barua pepe, nenosiri na tarehe ya kuzaliwa yanaweza kuainishwa kama \"maelezo ya kibinafsi.\n\n Hasa,\n (a) Chini ya Amri ya 72/2013, maelezo ya kibinafsi yanafafanuliwa kama taarifa ambayo imeambatishwa kwa utambulisho wa utambulisho na maelezo ya kibinafsi ya mtu binafsi ikiwa ni pamoja na jina, umri, anwani, nambari ya kitambulisho cha watu, nambari ya simu, barua pepe na taarifa nyingine. kama ilivyoainishwa na sheria\n\n (b) Chini ya Waraka wa 25/2010, maelezo ya kibinafsi yanamaanisha taarifa ya kutosha kumtambulisha mtu kwa usahihi, ambayo inajumuisha angalau moja ya maelezo yafuatayo: jina kamili, tarehe ya kuzaliwa, kazi, cheo, anwani ya mawasiliano, barua pepe, nambari ya simu, utambulisho. nambari ya kadi na nambari ya pasipoti. Taarifa za faragha ya kibinafsi ni pamoja na rekodi ya afya, rekodi ya malipo ya kodi, nambari ya kadi ya bima ya kijamii, nambari ya kadi ya mkopo na siri zingine za kibinafsi.\n\n Waraka wa 25 unatumika kwa ukusanyaji na matumizi ya taarifa za kibinafsi na tovuti zinazoendeshwa na mamlaka ya Serikali ya Vietnam. Waraka wa 25 hautumiki moja kwa moja kwa ukusanyaji na matumizi ya taarifa za kibinafsi na tovuti zinazoendeshwa na mashirika yasiyo ya Serikali. Hata hivyo, masharti ya Waraka wa 25 yanaweza kutumika kwa mlinganisho. Zaidi ya hayo, kuna uwezekano kuwa taasisi isiyo ya Kiserikali itakuwa chini ya viwango sawa au vikali zaidi kuliko vile vinavyotumika kwa taasisi ya Serikali."),
